import React, { useState } from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import AboutMe from './components/AboutMe';
import Services from './components/Services';
import Research from './components/Research';
import PatientResources from './components/PatientResources';
import Contact from './components/Contact';
import VascularSurgery from './components/VascularSurgery';
import './App.css';

const App = () => {
  const [activeScreen, setActiveScreen] = useState('home');

  const renderScreen = () => {
    switch (activeScreen) {
      case 'home':
        return <Home />;
      case 'about':
        return <AboutMe />;
      case 'services':
        return <Services setActiveScreen={setActiveScreen} />;
      case 'research':
        return <Research />;
      case 'patient-resources':
        return <PatientResources />;
      case 'contact':
        return <Contact />;
      case 'vascular-surgery':
        return <VascularSurgery />;
      default:
        return <Home />;
    }
  };

  return (
    <div className="App">
      <Navbar setActiveScreen={setActiveScreen} />
      {renderScreen()}
    </div>
  );
};

export default App;
